import React from 'react';
import { Box, Typography, Link, Grid, Divider, TextField, Button } from '@mui/material';
import { styled } from '@mui/system';
import baaMbooLogo from '../assets/mainlogo1.png';

const PageContainer = styled(Box)({
  maxWidth: '1440px',
  width: '100%',
  margin: '0 auto',
  padding: { xs: '0 15px', sm: '0 20px' },
});

const StyledFooter = styled(Box)({
  backgroundColor: '#000000', // Black background as requested
  color: '#ffffff',
  padding: '40px 0',
  bottom: 0,
  position: 'relative',
});

const FooterLink = styled(Link)({
  color: '#d3d3d3',
  textDecoration: 'none',
  fontSize: '0.9rem',
  transition: 'color 0.3s ease',
  '&:hover': {
    color: '#ffffff', // Slight color change on hover to match Ralph Lauren's subtle effect
  },
});

const FooterSectionTitle = styled(Typography)({
  color: '#ffffff',
  fontWeight: 'bold',
  marginBottom: '15px',
  fontSize: '1rem',
  textTransform: 'uppercase', // Match Ralph Lauren's uppercase headings
});

const SocialIcon = styled(Link)({
  color: '#ffffff',
  margin: '0 12px',
  fontSize: '1.5rem',
  transition: 'color 0.3s ease',
  '&:hover': {
    color: '#d3d3d3', // Subtle hover effect
  },
});

const LogoImage = styled('img')({
  height: '40px',
  width: '180px',
  marginBottom: '20px',
});

const NewsletterInput = styled(TextField)({
  '& .MuiInputBase-root': {
    backgroundColor: '#ffffff',
    borderRadius: '0px', // Ralph Lauren uses a sharp-edged input
    padding: '5px',
  },
  '& .MuiInputBase-input': {
    color: '#000000',
    fontSize: '0.9rem',
  },
});

const SubscribeButton = styled(Button)({
  backgroundColor: '#1a2526', // Dark color to match Ralph Lauren's button
  color: '#ffffff',
  padding: '8px 20px',
  borderRadius: '0px', // Sharp edges
  fontSize: '0.9rem',
  transition: 'backgroundColor 0.3s ease',
  '&:hover': {
    backgroundColor: '#2a3536',
  },
});

const Footer = () => {
  return (
    <StyledFooter component="footer">
      <PageContainer>
        <Grid container spacing={3} justifyContent="space-between">
          {/* Column 1: Customer Service */}
          <Grid item xs={12} sm={6} md={3}>
            <FooterSectionTitle variant="h6">Customer Service</FooterSectionTitle>
            <Box sx={{ display: 'flex', flexDirection: 'column', gap: 1 }}>
              <FooterLink href="#my-account">My Account</FooterLink>
              <FooterLink href="#live-chat">Live Chat</FooterLink>
              <FooterLink href="#customer-support">Customer Support</FooterLink>
              <FooterLink href="#shipping-delivery">Shipping & Delivery</FooterLink>
              <FooterLink href="#returns-exchanges">Returns & Exchanges Policy</FooterLink>
              <FooterLink href="#start-return">Start a Free Return or Exchange</FooterLink>
              <FooterLink href="#order-status">Check Order Status</FooterLink>
              <FooterLink href="#gift-cards">Gift Cards</FooterLink>
            </Box>
          </Grid>

          {/* Column 2: Company */}
          <Grid item xs={12} sm={6} md={3}>
            <FooterSectionTitle variant="h6">Company</FooterSectionTitle>
            <Box sx={{ display: 'flex', flexDirection: 'column', gap: 1 }}>
